  `addTime` datetime DEFAULT NULL COMMENT '增加时间',
  `status` int(2) DEFAULT '1' COMMENT '审核',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

